				this.drawScore();
			if(this.j_left <= 0 && this.stage_max <= 1)
				this.ml_mode = 100;
			else
				this.ml_mode = 90;
			if(this.stage >= 1 && this.stage <= 4)
				this.gs.playBGM(this.stage - 1);
